import React from 'react';
import './Styles/Navbar.css';
import Logo from './Logo'

function Navbar() {
    return (
        <table>
            <tbody>
            <th>About</th>
            <th>Products</th>
            <th><Logo/></th>
            <th>Images</th>
            <th>Contact</th>
            </tbody>  
      </table>  
    );
}

export default Navbar
